-- DDL of the table that drops the table if it exists and specifies
-- data characteristic variables.
DROP TABLE IF EXISTS S_aureus_JE2;
CREATE TABLE S_aureus_JE2 (
	Name VARCHAR(50),
	Bio_type VARCHAR(30),
	Location VARCHAR(40),
	Qualifier VARCHAR(16000),
	Primary KEY(Name)
);

